Captions:
Group Captain Shubhanshu Shukla, Indian Air Force test pilot, embarks on a historic journey aboard the SpaceX Dragon as part of the  mission on June 25, 2025. He becomes only the second Indian to travel to space, inspiring a new generation of explorers and dreamers.

Congratulations and best wishes to Group Captain Shukla and the entire Axiom-4 crew on this remarkable milestone in human spaceflight.


